import React from 'react';
import './Map.css'; // Import the CSS file

const Map = () => {
  return (
    <div className="container">
      <div className="row">
        <h2>
          Responsive <small>Google Maps</small>
        </h2>

        <div className="custom-box">
          <h3 className="text-center">Google Map Embed</h3>
          <div className="map-responsive">
            <iframe
              src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d470029.1604841957!2d72.29955005258641!3d23.019996818380896!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x395e848aba5bd449%3A0x4fcedd11614f6516!2sAhmedabad%2C+Gujarat!5e0!3m2!1sen!2sin!4v1511712235468"
              width="600"
              height="450"
              frameBorder="0"
              style={{ border: 0 }}
              allowFullScreen=""
              loading="lazy"
              title="Google Map"
            ></iframe>
          </div>
        </div>
      </div>
      <hr />
    </div>
  );
};

export default Map;
